import React from 'react';
import Table from 'react-bootstrap/Table';

const UserAccountsTable = (props) => {
    //class component to be
    //class component change state
    console.log(props)
    const userAccounts = props.users;
    console.log(userAccounts);
    const sortTableByName = () => {
        console.log(userAccounts)
        userAccounts.sort(function (a, b){return a.firstName.localeCompare((b.firstName))} );
        console.log(userAccounts)
        window.location.reload();

    }

    return (
        <Table id="userAccountsTable" striped bordered hover width="100%">
            <thead>
            <tr>
                <th class="th-sm">#</th>
                <th class="th-sm" onClick={sortTableByName}>First Name</th>
                <th class="th-sm">Last Name</th>
                <th class="th-sm">Email</th>
                <th class="th-sm">Date of Birth</th>
            </tr>
            </thead>

            <tbody>
            {userAccounts.map(account => (
                <tr>
                    <td>{account.id}</td>
                    <td>{account.firstName}</td>
                    <td>{account.lastName}</td>
                    <td>{account.emailAddress}</td>
                    <td>{account.dateOfBirth}</td>
                </tr>
            ))}
            </tbody>

        </Table>
    )
};

export default UserAccountsTable;
